import React from 'react'

function Hello () {
  const clickHandler = (e) => {
    console.log('函數組件中的事件被觸發了', e)
  }
  return <div onClick={clickHandler}>hello</div>
}

function App () {
  return (
    <div className="App">
      <Hello />
    </div>
  )
}

export default App
